---
title: Universal Column Metadata
---



::: {.cell}

:::




These tables provide the column metadata for all GAP oracle tables. These tables are created by the Resource Assessment and Conservation Engineering Division (RACE) Groundfish Assessment Program (GAP) of the Alaska Fisheries Science Center (AFSC). The GitHub repository for the scripts that created this code can be found at https://github.com/afsc-gap-products/gap_products. These data were last updated June 27, 2023. There are no legal restrictions on access to the data. For more information about codes used in the tables, please refer to the survey code books (https://www.fisheries.noaa.gov/resource/document/groundfish-survey-species-code-manual-and-data-codes-manual). 




::: {.cell tbl-cap='Universal stock metadata that users can use to document their table columns. '}
